import React from 'react';
import { Grid } from '@material-ui/core';

//Custom Import
import Card from './card';

export default function Orders() {
    return (
        <Grid container spacing={3}>
            <Grid item xs={3}>
                <Card />
            </Grid>
            <Grid item xs={3}>
                <Card />
            </Grid>
            <Grid item xs={3}>
                <Card />
            </Grid>
            <Grid item xs={3}>
                <Card />
            </Grid>
        </Grid>
    );
}
